import{_ as t}from"./chunks/v5_nano_01.DMHbymF9.js";import{_ as a,a as r}from"./chunks/cuav_nano_debug_cable.BXKuvqDb.js";import{_ as o,c as i,a8 as n,o as l}from"./chunks/framework.BDnHobkS.js";const v=JSON.parse('{"title":"CUAV V5 nano Autopilot","description":"","frontmatter":{},"headers":[],"relativePath":"en/flight_controller/cuav_v5_nano.md","filePath":"en/flight_controller/cuav_v5_nano.md"}'),s={name:"en/flight_controller/cuav_v5_nano.md"};function d(c,e,p,h,u,m){return l(),i("div",null,e[0]||(e[0]=[n('<h1 id="cuav-v5-nano-autopilot" tabindex="-1">CUAV V5 nano Autopilot <a class="header-anchor" href="#cuav-v5-nano-autopilot" aria-label="Permalink to &quot;CUAV V5 nano Autopilot&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p><strong>V5 nano</strong><sup>®</sup> is an autopilot for space-constrained applications, designed by CUAV<sup>®</sup> in collaboration with the PX4 team.</p><p>The autopilot is small enough to use in 220mm racing drones, but remains powerful enough for most drone use.</p><p><img src="'+t+'" alt="V5 nano - Hero image"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The V5 nano is similar to the <a href="./../flight_controller/cuav_v5_plus.html">CUAV V5+</a>, but has an all-in-one form factor, fewer PWM ports (can&#39;t be used for <a href="./../airframes/airframe_reference.html">airframes</a> that use AUX ports), and does not have internal damping.</p></div><p>Some of its main features include:</p><ul><li>Full compatibility with the <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk project</a> <strong>FMUv5</strong> design standard and uses the <a href="https://pixhawk.org/pixhawk-connector-standard/" target="_blank" rel="noreferrer">Pixhawk Connector Standard</a> for all external interfaces.</li><li>More advanced processor, RAM and flash memory than FMU v3, along with more stable and reliable sensors.</li><li>Firmware-compatible with PX4.</li><li>Generous 2.6mm spacing for I/O pins, making it easier to use all the interfaces.</li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h3 id="quick-summary" tabindex="-1">Quick Summary <a class="header-anchor" href="#quick-summary" aria-label="Permalink to &quot;Quick Summary&quot;">​</a></h3><p>Main FMU Processor: STM32F765◦32 Bit Arm® Cortex®-M7, 216MHz, 2MB memory, 512KB RAM</p><ul><li><p>On-board sensors:</p><ul><li>Accel/Gyro: ICM-20689</li><li>Accel/Gyro: ICM-20602</li><li>Accel/Gyro: BMI055</li><li>Magnetometer: IST8310</li><li>Barometer: MS5611</li></ul></li><li><p>Interfaces: 8 PWM outputs</p><ul><li>3 dedicated PWM/Capture inputs on FMU</li><li>Dedicated R/C input for CPPM</li><li>Dedicated R/C input for Spektrum / DSM and S.Bus</li><li>Analog / PWM RSSI input</li><li>4 general purpose serial ports</li><li>3 I2C ports</li><li>4 SPI buses</li><li>2 CAN Buses</li><li>Analog inputs for voltage / current of battery</li><li>2 additional analog inputs</li><li>Supports nARMED</li></ul></li><li><p>Power System: Power Brick Input: 4.75~5.5V</p></li><li><p>USB Power Input: 4.75~5.25V</p></li><li><p>Weight and Dimensions:</p><ul><li>Dimensions: 60*40*14mm</li></ul></li><li><p>Other Characteristics:</p><ul><li>Operating temperature: -20 ~ 85°C （Measured value）</li></ul></li></ul><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><p><a href="https://store.cuav.net/shop/v5-nano/" target="_blank" rel="noreferrer">CUAV Store</a></p><p><a href="https://www.aliexpress.com/item/33050770314.html?storeId=3257035&amp;spm=2114.12010612.8148356.9.dbe6790bjW2hpH" target="_blank" rel="noreferrer">CUAV Aliexpress</a> (international users)</p><p><a href="https://item.taobao.com/item.htm?spm=a230r.1.14.8.26ab5258veQJRu&amp;id=569404317857&amp;ns=1&amp;abbucket=13#detail" target="_blank" rel="noreferrer">CUAV Taobao</a> (China Mainland users)</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Autopilot may be purchased with included Neo GPS module</p></div><p><a id="connection"></a></p><h2 id="connections-wiring" tabindex="-1">Connections (Wiring) <a class="header-anchor" href="#connections-wiring" aria-label="Permalink to &quot;Connections (Wiring)&quot;">​</a></h2><p><a href="./../assembly/quick_start_cuav_v5_nano.html">V5 nano Wiring Quickstart</a></p><h2 id="pinouts" tabindex="-1">Pinouts <a class="header-anchor" href="#pinouts" aria-label="Permalink to &quot;Pinouts&quot;">​</a></h2><p>Download <strong>V5 nano</strong> pinouts from <a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">here</a>.</p><h2 id="building-firmware" tabindex="-1">Building Firmware <a class="header-anchor" href="#building-firmware" aria-label="Permalink to &quot;Building Firmware&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make px4_fmu-v5_default</span></span></code></pre></div><p><a id="debug_port"></a></p><h2 id="debug-port" tabindex="-1">Debug Port <a class="header-anchor" href="#debug-port" aria-label="Permalink to &quot;Debug Port&quot;">​</a></h2><p>The <a href="./../debug/system_console.html">PX4 System Console</a> and <a href="./../debug/swd_debug.html">SWD interface</a> operate on the <strong>FMU Debug</strong> port (<code>DSU7</code>). The board does not have an I/O debug interface.</p><p><img src="'+a+'" alt="Debug port (DSU7)"></p><p>The debug port (<code>DSU7</code>) uses a <a href="https://www.digikey.com.au/product-detail/en/jst-sales-america-inc/BM06B-GHS-TBT-LF-SN-N/455-1582-1-ND/807850" target="_blank" rel="noreferrer">JST BM06B</a> connector and has the following pinout:</p><table tabindex="0"><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>5V+</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>DEBUG TX (OUT)</td><td>+3.3V</td></tr><tr><td>3 (blk)</td><td>DEBUG RX (IN)</td><td>+3.3V</td></tr><tr><td>4 (blk)</td><td>FMU_SWDIO</td><td>+3.3V</td></tr><tr><td>5 (blk)</td><td>FMU_SWCLK</td><td>+3.3V</td></tr><tr><td>6 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><p>The product package includes a convenient debug cable that can be connected to the <code>DSU7</code> port. This splits out an FTDI cable for connecting the <a href="./../debug/system_console.html">PX4 System Console</a> to a computer USB port, and SWD pins used for SWD/JTAG debugging. The provided debug cable does not connect to the SWD port <code>Vref</code> pin (1).</p><p><img src="'+r+'" alt="CUAV Debug cable"></p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The SWD Vref pin (1) uses 5V as Vref but the CPU is run at 3.3V!</p><p>Some JTAG adapters (SEGGER J-Link) will use the Vref voltage to set the voltage on the SWD lines. For direct connection to <em>Segger Jlink</em> we recommended you use the 3.3 Volts from pin 4 of the connector marked <code>DSM</code>/<code>SBUS</code>/<code>RSSI</code> to provide <code>Vtref</code> to the JTAG (i.e. providing 3.3V and <em>NOT</em> 5V).</p><p>For more information see <a href="#using-jtag-for-hardware-debugging">Using JTAG for hardware debugging</a>.</p></div><h2 id="serial-port-mapping" tabindex="-1">Serial Port Mapping <a class="header-anchor" href="#serial-port-mapping" aria-label="Permalink to &quot;Serial Port Mapping&quot;">​</a></h2><table tabindex="0"><thead><tr><th>UART</th><th>Device</th><th>Port</th></tr></thead><tbody><tr><td>UART1</td><td>/dev/ttyS0</td><td>GPS</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM1 (flow control)</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>TELEM2 (flow control)</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>TELEM4</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>TX is RC input from SBUS_RC connector</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>Debug Console</td></tr><tr><td>UART8</td><td>/dev/ttyS6</td><td>Not connected (no PX4IO)</td></tr></tbody></table><h2 id="voltage-ratings" tabindex="-1">Voltage Ratings <a class="header-anchor" href="#voltage-ratings" aria-label="Permalink to &quot;Voltage Ratings&quot;">​</a></h2><p><em>V5 nano</em> must be powered from the <code>Power</code> connector during flight, and may also/alternatively be powered from <code>USB</code> for bench testing.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The <code>PM2</code> connector cannot not be used for powering the <em>V5 nano</em> (see <a href="#compatibility_pm2">this issue</a>).</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The Servo Power Rail is neither powered by, nor provides power to the FMU. However, the pins marked <strong>+</strong> are all common, and a BEC may be connected to any of the servo pin sets to power the servo power rail.</p></div><h2 id="over-current-protection" tabindex="-1">Over Current Protection <a class="header-anchor" href="#over-current-protection" aria-label="Permalink to &quot;Over Current Protection&quot;">​</a></h2><p>The <em>V5 nano</em> has no over current protection.</p><p><a id="Optional-hardware"></a></p><h2 id="peripherals" tabindex="-1">Peripherals <a class="header-anchor" href="#peripherals" aria-label="Permalink to &quot;Peripherals&quot;">​</a></h2><ul><li><a href="https://item.taobao.com/item.htm?spm=a1z10.3-c-s.w4002-16371268452.37.6d9f48afsFgGZI&amp;id=9512463037" target="_blank" rel="noreferrer">Digital Airspeed Sensor</a></li><li><a href="https://cuav.taobao.com/category-158480951.htm?spm=2013.1.w5002-16371268426.4.410b7a821qYbBq&amp;search=y&amp;catName=%CA%FD%B4%AB%B5%E7%CC%A8" target="_blank" rel="noreferrer">Telemetry Radio Modules</a></li><li><a href="./../sensor/rangefinders.html">Rangefinders/Distance sensors</a></li></ul><h2 id="supported-platforms-airframes" tabindex="-1">Supported Platforms / Airframes <a class="header-anchor" href="#supported-platforms-airframes" aria-label="Permalink to &quot;Supported Platforms / Airframes&quot;">​</a></h2><p>Any multicopter / airplane / rover or boat that can be controlled with normal RC servos or Futaba S-Bus servos. The complete set of supported configurations can be seen in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><h2 id="compatibility" tabindex="-1">Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;Compatibility&quot;">​</a></h2><p>CUAV adopts some differentiated designs and is incompatible with some hardware, which will be described below.</p><p><a id="compatibility_gps"></a></p><h4 id="neo-v2-0-gps-not-compatible-with-other-devices" tabindex="-1">Neo v2.0 GPS not compatible with other devices <a class="header-anchor" href="#neo-v2-0-gps-not-compatible-with-other-devices" aria-label="Permalink to &quot;Neo v2.0 GPS not compatible with other devices&quot;">​</a></h4><p>The <em>Neo v2.0 GPS</em> that is recommended for use with <em>CUAV V5+</em> and <em>CUAV V5 nano</em> is not fully compatible with other Pixhawk flight controllers (specifically, the buzzer part is not compatible and there may be issues with the safety switch).</p><p>The UAVCAN <a href="http://doc.cuav.net/gps/neo-series-gnss/en/neo-v2-pro.html" target="_blank" rel="noreferrer">NEO V2 PRO GNSS receiver</a> can also be used, and is compatible with other flight controllers.</p><p><a id="compatibility_jtag"></a></p><h4 id="using-jtag-for-hardware-debugging" tabindex="-1">Using JTAG for hardware debugging <a class="header-anchor" href="#using-jtag-for-hardware-debugging" aria-label="Permalink to &quot;Using JTAG for hardware debugging&quot;">​</a></h4><p><code>DSU7</code> FMU Debug Pin 1 is 5 volts - not the 3.3 volts of the CPU.</p><p>Some JTAG probes use this voltage to set the IO levels when communicating to the target.</p><p>For direct connection to <em>Segger Jlink</em> we recommended you use the 3.3 Volts of DSM/SBUS/RSSI pin 4 as Pin 1 on the debug connector (<code>Vtref</code>).</p><p><a id="compatibility_pm2"></a></p><h4 id="pm2-cannot-power-the-flight-controller" tabindex="-1">PM2 cannot power the flight controller <a class="header-anchor" href="#pm2-cannot-power-the-flight-controller" aria-label="Permalink to &quot;PM2 cannot power the flight controller&quot;">​</a></h4><p><code>PM2</code> can only measure battery voltage and current, but <strong>not</strong> power the flight controller.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not support this interface.</p></div><h2 id="known-issues" tabindex="-1">Known Issues <a class="header-anchor" href="#known-issues" aria-label="Permalink to &quot;Known Issues&quot;">​</a></h2><p>The issues below refer to the <em>batch number</em> in which they first appear. The batch number is the four-digit production date behind V01 and is displayed on a sticker on the side of the flight controller. For example, the serial number Batch V011904((V01 is the number of V5, 1904 is the production date, that is, the batch number).</p><p><a id="pin1_unfused"></a></p><h4 id="sbus-dsm-rssi-interface-pin1-unfused" tabindex="-1">SBUS / DSM / RSSI interface Pin1 unfused <a class="header-anchor" href="#sbus-dsm-rssi-interface-pin1-unfused" aria-label="Permalink to &quot;SBUS / DSM / RSSI interface Pin1 unfused&quot;">​</a></h4><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This is a safety issue.</p></div><p>Please do not connect other equipment (except RC receiver) on SBUS / DSM / RSSI interface - this can lead to equipment damage!</p><ul><li><em>Found:</em> Batches V01190904xxxx</li><li><em>Fixed:</em> Batches later than V01190904xxxx</li></ul><h2 id="further-information" tabindex="-1">Further Information <a class="header-anchor" href="#further-information" aria-label="Permalink to &quot;Further Information&quot;">​</a></h2><ul><li><a href="http://manual.cuav.net/V5-nano.pdf" target="_blank" rel="noreferrer">V5 nano manual</a> (CUAV)</li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 reference design pinout</a> (CUAV)</li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github</a> (CUAV)</li><li><a href="./../frames_multicopter/dji_f450_cuav_5nano.html">Airframe build-log using CUAV v5 nano on a DJI FlameWheel450</a></li></ul>',72)]))}const S=o(s,[["render",d]]);export{v as __pageData,S as default};
